    completeTask(results) {
        const meta = {
            "system_id": "DOC.COM",
            "committer_name": "Dr. Vergas",
            "composer_id": "c8915ebf-0bee-4980-a7d7-5f204c4e1f01",
            "composer_name": "DOC COMPOSER",
            "composition_setting_value": "COMPOSITION SETTING VALUE",
            "composition_setting_code": "COMPOSITION SETTING CODE"
        }
        let value = {meta, data: results}
        const processVariables = new Variables()
        processVariables.setTyped("answers", {
            value: JSON.stringify(value),
            type: "Json",
            valueInfo: {
                transient: true
            }
        })

        processVariables.setTyped("committer", {
            value: "Dr. Chopper",
            type: "string",
            valueInfo: {
                transient: true
            }
        })

        dat.state.taskService.complete(dat.state.task, processVariables)
        dat.cleanData()
    }

    cleanData() {
        dat.setState({
            token: '',
            templateId: '',
            ehrId: '',
            committer: '',
            isLoading: false,
            html: '',
            task: '',
            taskService: ''
        })
    }

    render() {
        const {token, templateId, ehrId, committer, isLoading, html} = this.state
        return (
            <>
                {this.state.html !== '' ? (
                    <form onSubmit={this.submitForm}>
                        <SanitizedHTML
                            allowedTags={false}
                            allowedAttributes={false}
                            html={html}/>
                        <div className="mt-4 mb-4">
                            <button className="btn btn-primary mr-4">Send Form</button>
                            <button className="btn btn-warning ml-4" onClick={this.submitTestForm}>Send Test Form
                            </button>
                        </div>
                    </form>
                ) : (
                    <div className="card">
                        <form onSubmit={this.handleSubmit} className="card-body">
                            <div className="form-group">
                                <input
                                    type="text"
                                    name="token"
                                    className="form-control"
                                    value={token}
                                    onChange={this.handleChange}
                                    placeholder="Auth Token"
                                />
                            </div>
                            <div className="form-group">
                                <input
                                    type="text"
                                    name="templateId"
                                    className="form-control"
                                    value={templateId}
                                    onChange={this.handleChange}
                                    placeholder="Template Id"
                                />
                            </div>
                            <div className="form-group">
                                <input
                                    type="text"
                                    name="ehrId"
                                    className="form-control"
                                    value={ehrId}
                                    onChange={this.handleChange}
                                    placeholder="EHR Id"
                                />
                            </div>
                            <div className="form-group">
                                <input
                                    type="text"
                                    name="committer"
                                    className="form-control"
                                    value={committer}
                                    onChange={this.handleChange}
                                    placeholder="Committer"
                                />
                            </div>
                            <button type="submit" className="btn btn-primary" disabled={isLoading}>
                                {isLoading && (
                                    <i
                                        className="fa fa-refresh fa-spin"
                                        style={{marginRight: "10px"}}
                                    />
                                )}
                                {isLoading && <span>Downloading form</span>}
                                {!isLoading && <span>Download form</span>}
                            </button>
                        </form>
                    </div>
                )}
            </>
        )
    }

